<script lang="ts">
	import { gsap } from 'gsap';
	import { onMount } from 'svelte';

	let props = $props();
	let show = $state(true);

	let headphones: SVGSVGElement;
	let splashPath: SVGPathElement;

	const animationOptions = { ease: 'back.out', duration: 1 };
	onMount(() => {
		gsap
			.timeline({ repeat: -1, yoyo: true, delay: 0 })
			.fromTo(
				splashPath,
				{ opacity: '0%', ...animationOptions },
				{ opacity: '100%', ...animationOptions },
				'same'
			)
			.fromTo(
				headphones,
				{ rotationZ: -10, scale: 1.1, ...animationOptions },
				{ rotationZ: 10, scale: 1, ...animationOptions },
				'same'
			);
	});
</script>

